if mibBuilder.loadTexts: ciscoIvrMIB.setDescription("The MIB module for the management of Inter-VSAN routing within the framework of Cisco's Inter-VSAN Routing (IVR) Architecture. IVR allows traffic between VSANs. VSANs are logically separated Storage Area Networks (SANs) where traffic does not cross VSAN boundaries. Certain SAN applications need restricted communication between initiators and targets which are in different VSANs. This MIB enables the users to manage IVR. The VSANs logically separate a single physical fabric into multiple logical fabrics. Each of these physical fabrics are called Autonmous Fabrics. In addition to Inter-VSAN communication, IVR also enables communication between Autonomous Fabrics. Acronyms The following acronyms are used in this document: Lun: Logical Unit Number IV: Inter-VSAN IVR: Inter-VSAN Routing PWWN: Port World Wide Name AFID: Autonomous Fabric id ")
