if mibBuilder.loadTexts: civrZoneSetActvatDeactvatResult.setDescription("This object indicates the outcome of the most recent activation/deactivation. activateSuccess - activation success activateFailureNoMembers - activation failure because of no members in the zoneset activateFailureZoneOneorLessMem - activation failure as the zoneset being activated contained one or less member. activateFailureNoTopology - activation failure because of no IVR topology activateFailureNoPerVsanSucc - activation failed in all 'activate VSANs' activateFailureNoZoneset - activation failure because of no zoneset activateFailureNoVsans - activation failure because of no 'activate VSANs' activateFailureFabricUnstable - activation failure because fabric unstable deactivateSuccess - deactivation success deactivateFailureNoActiveZs - no active zoneseset deactivateFailureNoPerVsanSucc - deactivation failed in all 'activate VSANs' deactivateFailureFabricUnstable - deactivation failed because fabric is unstable activating - activation in progress deactivating - deactivation in progress idle - idle deactivateSuccessFcNatShutup13 - deactivation success, shutup 1.3 switch in NAT mode activateFailureFabric - none of the switches connected to the fabric is able to activate this zoneset deactivateFailureFabric - none of the switches connected to the fabric is able to deactivate this zoneset activatePartialSuccessFabric - activation succeeds on some of the switches connected to this fabric deactivatePartialSuccessFabric - deactivation succeeds on some of the switches connected to this fabric deviceCleanupInProgress - device cleanup is in progress during deactivation activatingReadyToAdv - switches connected to this fabric are ready to advertise device changes activatingAdvertising - switches connected to this fabric are advertising device change information When the value of this object is either 'activating', or 'deactivating', the values of of civrZoneSetActivate and civrZoneSetDeActivate respectively cannot be modified.")
